<!DOCTYPE html>
<html lang="en">
    <head>
        <meta charset="UTF-8">
        <link rel = "stylesheet" href = "index.css">
        <link rel = "stylesheet" href = "button.css">
        <title>Rising Sun Beta</title>
    </head>
    <body>
        <div id = "Start">
            <div id = "StartButtonDIV">
                <button class = "button" id = "StartButton" onclick = "Start()">Start</button>
            </div>
        </div>
        <div id = "Loading">

        </div>
        <div id = "Game">
            <div class = "header">
                <h1>Rising Sun</h1>
            </div>
            <div id = "LB" class = "LSB">
                <button id = "LMP" class = "MapControl button" onclick = "Back()">Back</button>
                
                <button id = "EndTurn" class = "button" onclick = "EndTurn()">End Turn</button>
            </div>
            <div id = "RB2" class = "RSB">
                <button id = "PlaceCivFactory" class = "PlaceButton button" onclick = "placeCivFactory()">Civilian Factory</button>
                <button id = "PlaceMilFactory" class = "PlaceButton button" onclick = "placeMilFactory()">Military Factory</button>
                <button id = "PlaceFarm" class = "PlaceButton button" onclick = "placeFarm()">Farm</button>
                <button id = "PlaceVillage" class = "PlaceButton button" onclick = "placeVillage()">Village</button>
                <button id = "PlaceLumberjack" class = "PlaceButton button" onclick = "placeLumberjack()">Lumberjack</button>
                <button id = "PlaceMine" class = "PlaceButton button" onclick = "placeMine()">Mine</button>
                <button id = "PlaceSoldier" class = "PlaceButton button" onclick = "placeSoldier()">Soldier</button>
                <button id = "Demolish" class = "button" onclick = "Demolish()">Demolish</button>
            </div>
            <div id = "RBSoldier" class = "RSB">
                <button id = "MoveUp" class = "button" onclick = "Movement(-14)">Up</button>
                <button id = "MoveLeft" class = "button" onclick = "Movement(-1)">Left</button>
                <button id = "MoveRight" class = "button" onclick = "Movement(1)">Right</button>
                <button id = "MoveDown" class = "button" onclick = "Movement(14)">Down</button>
                <button id = "DeActMoveMenu" class = "button" onclick = "DeActMoveMenu()">Back</button>
            </div>
            <div id = "RB" class = "RSB">
                <h2 id = "DistrictName" class = "RLabelDistrict"></h2>
                <h3 id = "DistrictBuildings" class = "RLabelDistrict"></h3>
                <h3 id = "DistrictPopulation" class = "RLabelDistrict"></h3>
                <button id = "ZoomIn" class = "button RLabelDistrict" onclick = "Zoom2()">Select</button>
                <label class="rocker" id = "CB1">
                    <input type="checkbox" id = "MapPanCB" onclick="MapPanChecked()">
                    <span class="switch-left">Pan</span>
                    <span class="switch-right">Sel</span>
                </label>
            </div>
            <div id = "menu">
                <h1 id = "TurnCount">Turn: 0</h1>
                <table id = "PopulationTable">
                    <tr>
                        <td><img id = "PopulationIMG" class = "Icon" src = "Population.jpg"></td>
                        <td id = "Population">Total Population: 0</td>
                    </tr>
                </table>
                <table id = "MoneyTable">
                    <tr>
                        <td><img id = "MoneyIMG" class = "Icon" src = "Money.jpg"></td>
                        <td id = "Money">Money: 0</td>
                    </tr>
                </table>
                <table id = "WoodTable">
                    <tr>
                        <td><img id = "WoodIMG" class = "Icon" src = "Wood.jpg"></td>
                        <td id = "Wood">Wood: 0</td>
                    </tr>
                </table>
                <table id = "FoodTable">
                    <tr>
                        <td><img id = "FoodIMG" class = "Icon" src = "Food.jpg"></td>
                        <td id = "Food">Food: 0</td>
                    </tr>
                </table>
                <table id = "SteelTable">
                    <tr>
                        <td><img id = "IronIMG" class = "Icon" src = "Iron.jpg"></td>
                        <td id = "Steel">Steel: 0</td>
                    </tr>
                </table>
                <table id = "WeaponsTable">
                    <tr>
                        <td><img id = "WeaponIMG" class = "Icon" src = "Weapon.jpg"></td>
                        <td id = "Weapons">Weapons: 0</td>
                    </tr>
                </table>
                <h3 id = "BuildingLevel"></h3>
